import { Component } from "@angular/core";
import { User, UserService } from "src/app/services/user.service";

@Component({
  selector: "app-header",
  template: `
    <header data-bs-theme="dark">
      <nav class="navbar navbar-expand-md navbar-dark fixed-top bg-dark">
        <div class="container-fluid">
          <a class="navbar-brand" href="#">CTF Writeups</a>
          <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarCollapse" aria-controls="navbarCollapse" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="navbarCollapse">
            <ul class="navbar-nav me-auto mb-2 mb-md-0">
              <li class="nav-item">
                <a class="nav-link active" aria-current="page" href="#">Top</a>
              </li>
              <li class="nav-item">
                <a class="nav-link" routerLink="['/search']">Search</a>
              </li>
              <li class="nav-item">
                <a class="nav-link" routerLink="['/about']">About</a>
              </li>
            </ul>

            <div class="col-md-3 text-end">
              <button *ngIf="me.id" type="button" class="btn btn-warning" [routerLink]="['/submit']">Submit</button>
              <button *ngIf="!me.id" type="button" class="btn btn-warning" [routerLink]="['/login']">Login</button>
              <button *ngIf="me.id" type="button" class="btn btn-warning" [routerLink]="['/logout']">Logout</button>
            </div>
          </div>
        </div>
      </nav>
    </header>
  `,
  styles: [],
})
export class HeaderComponent {
  me: User = {} as User;

  constructor(private userService: UserService) {}

  ngOnInit() {
    this.userService.getMe().subscribe((me) => {
      this.me = me;
    });
  }
}
